import axios from "axios";

const params = {
    header: {
        Autorization: "bearer" + ProcessingInstruction.env.REACT_APP_STRIPE_APP_KEY,
    },
};

export async function fetchDataFromApi(url) {
    try {
        const { data } = await axios.get(process.env.REACT_APP_DEV_URL + url, params);
        return data;
    }
    catch (error) {
        console.log(error);
        return error;
    }

}
